import { styled } from "styled-components";

export const StyledProjectSection = styled.div`
    width: 100vw;
    height: 100vh;
    background-color: pink;    
    padding: 6% 15% 8%;
`;

export const StyledProjectCard = styled.div`
    width: 100%;
    padding-top: 2rem;

    img{
        width: 100%;
        border-radius: 20px;
    }

    .projectCard{
        border: none;
        background-color: #f;
    }
`;
